        public string RandomAlphanumeric(int length)
        {
            var chars = "ABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789";
            var random = new Random(GetRandomSeed());
            var result = new string(
                Enumerable.Repeat(chars, length)
                          .Select(s => s[random.Next(s.Length)])
                          .ToArray());

            for (int i = 0; i < result.Length; i++)
            {
                if (i % 2 == 0)
                {
                    result = result.Replace(result.Substring(i, 1), result.Substring(i, 1).ToLower());
                }
            }

            if (string.IsNullOrEmpty(ExtractNumbers(result)))
            {
                result = "0" + result.Substring(1);
            }

            return result;
        }

        public string ExtractNumbers(string toNormalize)
        {
            string resultString = string.Empty;
            Regex regexObj = new Regex(@"[^\d]");
            resultString = regexObj.Replace(toNormalize, "");
            return resultString;
        }

        public string RemoveNumbers(string toNormalize)
        {
            return toNormalize
                .Replace("0", "")
                .Replace("1", "")
                .Replace("2", "")
                .Replace("3", "")
                .Replace("4", "")
                .Replace("5", "")
                .Replace("6", "")
                .Replace("7", "")
                .Replace("8", "")
                .Replace("9", "");
        }

        public string RemoveAccentsAndSpecialCharacteres(string text)
        {
            string withAccents = "ÄÅÁÂÀÃäáâàãÉÊËÈéêëèÍÎÏÌíîïìÖÓÔÒÕöóôòõÜÚÛüúûùÇçñÑ";
            string withoutAccents = "AAAAAAaaaaaEEEEeeeeIIIIiiiiOOOOOoooooUUUuuuuCcñN";
            string specialCharacteres = @"'!@#$£%¢¨¬&*()-_+=§|\<,>.:;?/°´`^~{[ª}]º";

            if (text != "")
            {
                for (int i = 0; i < withAccents.Length; i++)
                {
                    text = text.Replace(withAccents[i].ToString(), withoutAccents[i].ToString());
                }

                for (int i = 0; i < specialCharacteres.Length; i++)
                {
                    text = text.Replace(specialCharacteres[i].ToString(), "");
                }
            }

            return text;
        }

        public string RemoveAccents(string text)
        {
            string withAccents = "ÄÅÁÂÀÃäáâàãÉÊËÈéêëèÍÎÏÌíîïìÖÓÔÒÕöóôòõÜÚÛüúûùÇçñÑ";
            string withoutAccents = "AAAAAAaaaaaEEEEeeeeIIIIiiiiOOOOOoooooUUUuuuuCcñN";

            if (text != "")
            {
                for (int i = 0; i < withAccents.Length; i++)
                {
                    text = text.Replace(withAccents[i].ToString(), withoutAccents[i].ToString());
                }
            }

            return text;
        }

