        public bool SendMSGraphMail(string iduser, List<string> receivers, string title, string body, string typeAttachment, string nameAttachment, string attachament, string toMail, string token)
        {
            //return false;
            if (string.IsNullOrEmpty(token))
            {
                token = GetGraphTokenDB();
                if (token == "")
                    token = GetGraphToken();
            }

            string url = "https://graph.microsoft.com/v1.0/users/" + iduser + "/sendMail";

            GraphMailSender mailParams = new GraphMailSender();
            mailParams.saveToSentItems = "true";
            mailParams.message = new Message();

            mailParams.message.body = new MailBody();
            mailParams.message.subject = title;
            mailParams.message.body.contentType = "HTML";
            mailParams.message.body.content = body;

            mailParams.message.toRecipients = new List<Recipient>();
            mailParams.message.toRecipients.Add(new Recipient { emailAddress = new MailEmailAddress { address = toMail } });

            mailParams.message.bccRecipients = new List<Recipient>();
            foreach (string receive in receivers)
            {
                mailParams.message.bccRecipients.Add(new Recipient { emailAddress = new MailEmailAddress { address = receive } });
            }

            mailParams.message.attachments = new List<Models.Attachment>();
            Models.Attachment tempAttachment = new Models.Attachment();
            if (typeAttachment == "doc")
                tempAttachment.contentType = "application/doc";
            else if (typeAttachment == "docx")
                tempAttachment.contentType = "application/docx";
            else if (typeAttachment == "pdf")
                tempAttachment.contentType = "application/pdf";
            tempAttachment.name = nameAttachment;
            tempAttachment.OdataType = "#microsoft.graph.fileAttachment";
            tempAttachment.contentBytes = attachament;
            if (!string.IsNullOrEmpty(tempAttachment.contentType))
                mailParams.message.attachments.Add(tempAttachment);

            var web_request = WebRequest.CreateHttp(url);
            web_request.Method = "POST";
            web_request.Headers.Add("Authorization", token);
            web_request.ContentType = "application/json";

            try
            {
                using (var streamWriter = new StreamWriter(web_request.GetRequestStream()))
                {
                    string json = JsonConvert.SerializeObject(mailParams);
                    streamWriter.Write(json);
                }
            }
            catch (Exception e)
            {
                throw e;
            }

            try
            {
                using (var web_request_response = web_request.GetResponse())
                {
                    var streamDados = web_request_response.GetResponseStream();
                    StreamReader reader = new StreamReader(streamDados);
                    object objResponse = reader.ReadToEnd();
                    var tempNothing = objResponse.ToString();
                    streamDados.Close();
                    web_request_response.Close();
                }
            }
            catch (WebException e2)
            {
                string httpError = "";

                using (WebResponse response = e2.Response)
                {
                    HttpWebResponse httpResponse = (HttpWebResponse)response;
                    using (Stream data = response.GetResponseStream())
                    using (var reader = new StreamReader(data))
                    {
                        httpError = reader.ReadToEnd();
                    }
                }

                throw e2;
            }
            
            return true;
        }

