        public DateTime ChangeYear(DateTime dt, int newYear)
        {
            return dt.AddYears(newYear - dt.Year);
        }

        private string GetGraphToken()
        {
            string token = "";

            string url = ConfigurationManager.AppSettings["urlGraph"];

            string auth_data =
                ConfigurationManager.AppSettings["clientIdGraph"] + "&" +
                ConfigurationManager.AppSettings["scopeGraph"] + "&" +
                ConfigurationManager.AppSettings["clientSecretGraph"] + "&" +
                ConfigurationManager.AppSettings["clientCredentialsGraph"];
                
            var auth_data_encoded = Encoding.UTF8.GetBytes(auth_data);

            var web_request = WebRequest.CreateHttp(url);
            web_request.Method = "POST";
            web_request.ContentType = "application/x-www-form-urlencoded";
            web_request.ContentLength = auth_data_encoded.Length;

            //precisamos escrever os dados post para o stream
            using (var stream = web_request.GetRequestStream())
            {
                stream.Write(auth_data_encoded, 0, auth_data_encoded.Length);
                stream.Close();
            }
            //ler e exibir a resposta
            using (var web_request_response = web_request.GetResponse())
            {
                var streamDados = web_request_response.GetResponseStream();
                StreamReader reader = new StreamReader(streamDados);
                object objResponse = reader.ReadToEnd();
                var auth_token = JsonConvert.DeserializeObject<GraphTokenModel>(objResponse.ToString());
                token = auth_token.access_token;
                streamDados.Close();
                web_request_response.Close();
            }

            PutGraphTokenDB(token);

            return token;
        }
        private string GetGraphTokenDB()
        {
            string token = "";

            QueryUtils queryUtils = new QueryUtils();

            string stQuery = "select accesstoken from TB_temptoken where registrationdate > DATEADD(minute, -35, GETDATE());";

            context = new Context();
            try
            {
                var retDT = context.RunCommandDT(stQuery);
                if (retDT.Rows.Count > 0)
                    token = retDT.Rows[0][0].ToString();
                context.Dispose();
            }
            catch
            {
                context.Dispose();
            }

            return token;
        }
        private void PutGraphTokenDB(string token)
        {
            string stQuery;
            QueryUtils queryUtils = new QueryUtils();

            stQuery = "INSERT INTO TB_temptoken (" +
                        "	 accesstoken" +
                        "	)" +
                        " VALUES (" +
                        "	 " + queryUtils.InsertSingleQuotes(token) +
                        "	)";

            context = new Context();
            try
            {
                context.RunCommand(stQuery);
                context.Dispose();
            }
            catch
            {
                context.Dispose();
            }
        }

        private int GetRandomSeed()
        {
            byte[] bytes = new byte[4];
            RNGCryptoServiceProvider rngCsp = new RNGCryptoServiceProvider();

            rngCsp.GetBytes(bytes);
            return BitConverter.ToInt32(bytes, 0);
        }

        public int GetRandomNumber(int startrange, int endrange)
        {
            Random rnd = new Random(GetRandomSeed());
            double rndvalue = Double.Parse((rnd.Next(startrange, endrange)).ToString("N2"));
            return Convert.ToInt32(rndvalue);
        }
    }
